geneInput.addEventListener("input", () => {
  const inputText = geneInput.value.toLowerCase();
  const filteredWords = wordList.filter((word) =>
    word.toLowerCase().startsWith(inputText)
  );
  populateSuggestionList(filteredWords);

  if (filteredWords.length === 0 || geneInput.value === "") {
    suggestionList.style.display = "none";
  } else {
    suggestionList.style.display = "block";
  }
});

function populateSuggestionList(filteredWords) {
  suggestionList.innerHTML = "";

  filteredWords.forEach((word) => {
    const liElement = document.createElement("li");
    liElement.textContent = word;
    liElement.addEventListener("click", () => {
      geneInput.value = word;
      suggestionList.innerHTML = "";
    });
    suggestionList.appendChild(liElement);
  });
}

document.addEventListener("click", (event) => {
  if (
    !geneInput.contains(event.target) &&
    !suggestionList.contains(event.target)
  ) {
    suggestionList.innerHTML = "";
  }
});

document.addEventListener("click", (event) => {
  if (
    !geneInput.contains(event.target) &&
    !suggestionList.contains(event.target)
  ) {
    suggestionList.style.display = "none";
  }
});
